import React, { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import Modal from 'react-bootstrap/Modal';
import userIcon from '../assets/user.png';
import './Login.css';

function Login() {
  const [show, setShow] = useState(false);
  const [isLoginSelected, setIsLoginSelected] = useState(true);

  // Manejador para mostrar el formulario de iniciar sesión
  const handleIniciarSesionClick = () => {
    setIsLoginSelected(true);
  };

  // Manejador para mostrar el formulario de registro
  const handleRegistrarseClick = () => {
    setIsLoginSelected(false);
  };

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  return (
    <>
      <button onClick={handleShow} className="icon-button">
        <img src={userIcon} alt="User" className="icon" />
        <p>Iniciar Sesión</p>
      </button>

      <Modal show={show} onHide={handleClose} size="md" centered>
        <Modal.Header closeButton>
          <Modal.Title>
            <div className="button-container">
              <button onClick={handleIniciarSesionClick} className={`iniciar-sesion ${isLoginSelected ? 'selected' : ''}`}>
                <p>Iniciar Sesión</p>
              </button>
              <button onClick={handleRegistrarseClick} className={`registrarse ${!isLoginSelected ? 'selected' : ''}`}>
                <p>Registrarse</p>
              </button>
            </div>
          </Modal.Title>
        </Modal.Header>
        <Modal.Body>
          {isLoginSelected ? (
            // Formulario de inicio de sesión
            <Form>
              <Form.Group className="mb-3" controlId="formBasicEmail">
                <Form.Label>Correo Electrónico</Form.Label>
                <Form.Control type="email" placeholder="Ingrese correo" />
              </Form.Group>
              <Form.Group className="mb-3" controlId="formBasicPassword">
                <Form.Label>Contraseña</Form.Label>
                <Form.Control type="password" placeholder="Contraseña" />
              </Form.Group>
              {/* Aquí puedes añadir más campos si son necesarios */}
            </Form>
          ) : (
            // Formulario de registro
            <Form>
              <Form.Group className="mb-3" controlId="formBasicNombre">
                <Form.Label>Nombre</Form.Label>
                <Form.Control type="text" placeholder="Ingrese nombre" />
              </Form.Group>
              <Form.Group className="mb-3" controlId="formBasicApellido">
                <Form.Label>Apellido</Form.Label>
                <Form.Control type="text" placeholder="Ingrese apellido" />
              </Form.Group>
              <Form.Group className="mb-3" controlId="formBasicID">
                <Form.Label>ID O RTN</Form.Label>
                <Form.Control type="text" placeholder="Ingrese ID o RTN" />
              </Form.Group>
              <Form.Group className="mb-3" controlId="formBasicEmail">
                <Form.Label>Correo Electrónico</Form.Label>
                <Form.Control type="email" placeholder="Ingrese correo" />
              </Form.Group>
              <Form.Group className="mb-3" controlId="formBasicPassword">
                <Form.Label>Contraseña</Form.Label>
                <Form.Control type="password" placeholder="Contraseña" />
              </Form.Group>
              <Form.Group className="mb-3" controlId="formBasicConfirmPassword">
                <Form.Label>Confirmar Contraseña</Form.Label>
                <Form.Control type="password" placeholder="Confirmar contraseña" />
              </Form.Group>
              {/* Otros campos necesarios para el registro */}
            </Form>
          )}
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleClose}>
            Cerrar
          </Button>
          <Button variant="primary" onClick={handleClose}>
            {isLoginSelected ? 'Iniciar Sesión' : 'Registrarse'}
          </Button>
        </Modal.Footer>
      </Modal>
    </>
  );
}

export default Login;
